import Page from "../../components/Page/Page.js";

function Skills(props) {
  return (
    <Page id="Skills" header="Skills">
      <div className='Skills-container'>
        <div>
          Computer
        </div>
        <div>
          Application
        </div>
      </div>
    </Page>
  );
}

export default Skills;
